range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"243037","type":"CustomJS"},{"attributes":{"source":{"id":"242669"}},"id":"242860","type":"CDSView"},{"attributes":{"bottom_units":"screen","coordinates":null,"fill_alpha":0.5,"fill_color":"lightgrey","group":null,"left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"242659","type":"BoxAnnotation"},{"attributes":{"coordinates":null,"formatter":{"id":"243005"},"group":null,"major_label_policy":{"id":"243006"},"minor_tick_line_color":null,"ticker":{"id":"242977"}},"id":"242976","type":"LinearAxis"},{"attributes":{"callback":null,"formatters":{"@datetime":"datetime"},"mode":"vline","point_policy":"follow_mouse","renderers":[{"id":"242910"}],"tooltips":[["Date","@datetime{%c}"],["Volume","@Volume{0.00 a}"]]},"id":"242912","type":"HoverTool"},{"attributes":{"data":{"Close":{"__ndarray__":"Gun7X2QTZ0BhEP1/QfRlQMq07P/SuWZAL+MBwMz8ZkB1zxUA/ixmQK4m9J8ad2ZAXYsWoO0YZ0DkcQegRw1rQIQGByBahGxAplcUwB7Ba0CBvA0gsgVtQOzZGOCnLmxA4vjrX+O9a0BJzP0fMfxuQJ/vAoC+fXBAdqDzv6GfcUBhEP1/QepwQLN/+b8eBXFAAAAAAACackDhvf5/l/pzQGO1+X+VuXFAdqDzv6HtckDPdwFA37VxQMoe/B/biXJARHP4/yxcckB6VPzfUdJxQM93AUDfJ3JA6LsAoO9VckD+WgMArEZzQDqVDADVjnJANNL3v8gkc0CaAA2AwjNyQF5c9F+RlXFAFZD2P2AzcUDkcQegRz9xQJ/vAoC+gXBAu1EaIIfabUDxyA7go7RuQDiGAOB4TXBAYRD9f0GAc0BLcfofhTd2QHag87+h7XZAah0LwPW+c0CDYQogBm12QLN/+b8ek3VAah0LwPUCdkBLcfofhZd0
